import './App.css';
import Login from './Login';
import Home from './Home';
import Signup from './Signup';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import PickLeagues from './PickLeagues';
import PickTeams from './PickTeams';
import { UserProvider } from './UserContext'
import 'bootstrap/dist/css/bootstrap.min.css';
import { Auth0Provider } from "@auth0/auth0-react";

function App() {

  return (

    <Auth0Provider
    domain="dev-gzxtkka4.us.auth0.com"
    clientId="NEzwaxyFFgHHI1uemnsueN2BSH3qanBs"
    redirectUri={window.location.origin}
  >
      <UserProvider>
        <h1 style={{textAlign:"center"}}>MySportsHub</h1>
        <Router>
          <div className="App">
            <div className="App-container">            
              <div>
                <Switch>
                  <Route path="/" exact component={Login} />
                  <Route path="/Home" component={Home} />
                  <Route path="/Signup" component={Signup} />
                  <Route path="/PickLeagues" exact component={PickLeagues} />
                  <Route path="/PickTeams" exact component={PickTeams} />
                </Switch>
              </div>
            </div>
          </div>
        </Router>
      </UserProvider>
    </Auth0Provider>
  );
}

export default App;
